import React, { useContext } from 'react';
import userContext from '../../context/user/userContext';


const Cards = ({name,lastname,avatar,id}) => {

    const userCont = useContext(userContext);
    const { getIdFn } = userCont;


    return ( 
        <div className="col-md-4">
            <div className="col-md-4">
            <img className="card-header" src={avatar} alt=""/>
            <h1 className="card-header">{name} {lastname}</h1>
            <div className="estado">
            <button
                onClick={()=>{
                    getIdFn(id);
                }}
            type="button" className="incompleto">Edit user</button>
            <button
            type="button" className="completo">Show more</button>
            </div>

        </div>
        </div>
     );
}

export default Cards;
